import React, { Component } from "react";
import NavBar from "./components/NavBar/NavBar";

class App extends Component {
  render() {
    return (
      <div>
        <NavBar />
        <div>
          <p>Work in progress.</p>
        </div>
      </div>
    );
  }
}

export default App;
